import * as React from 'react';
import * as TabsPrimitive from '@radix-ui/react-tabs';
import { cn } from '../../lib/utils';

const Tabs = TabsPrimitive.Root;

const TabsList = React.forwardRef(({ className, ...props }, ref) => (
  <TabsPrimitive.List
    ref={ref}
    className={cn(
      'wda-inline-flex wda-h-10 wda-items-center wda-justify-center wda-rounded-md wda-bg-muted wda-p-1 wda-text-muted-foreground',
      className
    )}
    {...props}
  />
));
TabsList.displayName = TabsPrimitive.List.displayName;

const TabsTrigger = React.forwardRef(({ className, ...props }, ref) => (
  <TabsPrimitive.Trigger
    ref={ref}
    className={cn(
      'wda-inline-flex wda-items-center wda-justify-center wda-whitespace-nowrap wda-rounded-sm wda-px-3 wda-py-1.5 wda-text-sm wda-font-medium wda-ring-offset-background wda-transition-all focus-visible:wda-outline-none focus-visible:wda-ring-2 focus-visible:wda-ring-ring focus-visible:wda-ring-offset-2 disabled:wda-pointer-events-none disabled:wda-opacity-50 data-[state=active]:wda-bg-background data-[state=active]:wda-text-foreground data-[state=active]:wda-shadow-sm',
      className
    )}
    {...props}
  />
));
TabsTrigger.displayName = TabsPrimitive.Trigger.displayName;

const TabsContent = React.forwardRef(({ className, ...props }, ref) => (
  <TabsPrimitive.Content
    ref={ref}
    className={cn(
      'wda-mt-2 wda-ring-offset-background focus-visible:wda-outline-none focus-visible:wda-ring-2 focus-visible:wda-ring-ring focus-visible:wda-ring-offset-2',
      className
    )}
    {...props}
  />
));
TabsContent.displayName = TabsPrimitive.Content.displayName;

export { Tabs, TabsList, TabsTrigger, TabsContent };
